import { useEffect, useRef, useState } from 'react'

const SchedulePage = (props) => {
  return (
    <div
      style={{
        flex: 1,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'column',
      }}
    >
      <div
        style={{
          display: 'flex',
          flexDirection: 'row',
          height: 30,
          width: '80%',
          backgroundColor: '#b9f0f7',
          borderRadius: 5,
          marginTop: 20,
        }}
      ></div>
    </div>
  )
}

export default SchedulePage
